import React from "react";
import { useFormContext } from "react-hook-form";
import { TextField } from "@mui/material";

const NameStep = () => {
  const { register } = useFormContext();
  return (
    <TextField
      label="Name"
      {...register("name", { required: true })}
      fullWidth
    />
  );
};

export default NameStep;
